ERVER::[HTTP_HOST]~&quot;&gt;Login&lt;/a&gt;\n		&lt;/div&gt;\n		&lt;div class=&quot;r-hand-size&quot;&gt;\n			&lt;img src=&quot;http://~SERVER::[HTTP_HOST]~/client_assets/images/logo/default.png&quot; class=&quot;default-logo&quot; /&gt;\n		&lt;/div&gt;\n	&lt;/div&gt;\n	&lt;div class=&quot;body-content&quot;&gt;\n		&lt;h2&gt;Automated Message for ~SERVER::[HTTP_HOST]~:&lt;/h2&gt;\n		&lt;p&gt;~POST::[question]~&lt;/p&gt;\n		&lt;p&gt;&lt;span style=&quot;font-size: 10px; color: #888888;&quot;&gt;This message is automated and is only sent to you when an update has been made. You will not be sent spam from this system. Please contact http://~SERVER::[HTTP_HOST]~ if you feel you have received this in error.&lt;/span&gt;&lt;/p&gt;\n	&lt;/div&gt;\n&lt;/div&gt;\n&lt;/body&gt;\n&lt;/html&gt;', '', 'on', 'rasclatt@me.com', '&lt;h3&gt;Thank you for your interest in our company.&lt;/h3&gt;', 'default', 'on');";

